import React, { useState, useEffect } from "react";

const Valikot = (props) => {
  const [maakunnat, setMaakunnat] = useState([]);
  console.log("vai tullaanko tänne ensin");

  useEffect(() => {
    console.log("tullaanko tänne ensin");
    setMaakunnat([props.maakunnat]);
  }, []);

  const lisaaPaikat = () => {
    console.log(maakunnat);
    Object.values(maakunnat).map((maakunta) => {
      console.log("maakunta:", maakunta);
    });
  };

  return (
    <div>
      <select>{lisaaPaikat()}</select>
    </div>
  );
};

export default Valikot;
